"use strict";(self.webpackChunkprojet_gru_minion_2024=self.webpackChunkprojet_gru_minion_2024||[]).push([[7775],{3688:e=>{e.exports=JSON.parse('{"blogPosts":[{"id":"/2024/05/06/semaine10","metadata":{"permalink":"/ProjetGruMinion2024/yadian/2024/05/06/semaine10","editUrl":"https://github.com/departement-info-cem/ProjetGruMinion2024/tree/main/yadian/2024-05-06-semaine10.md","source":"@site/yadian/2024-05-06-semaine10.md","title":"Semaine 10","description":"\xc0 venir","date":"2024-05-06T00:00:00.000Z","tags":[],"readingTime":0.01,"hasTruncateMarker":false,"authors":[{"name":"Yadian Betancourt Paujaud","title":"D\xe9veloppeur","url":"https://github.com/yadianbetancourt","imageURL":"https://avatars.githubusercontent.com/u/104099685?v=4","key":"yadian"}],"frontMatter":{"authors":"yadian"},"unlisted":false,"nextItem":{"title":"Semaine 9","permalink":"/ProjetGruMinion2024/yadian/2024/04/29/semaine9"}},"content":"\xc0 venir"},{"id":"/2024/04/29/semaine9","metadata":{"permalink":"/ProjetGruMinion2024/yadian/2024/04/29/semaine9","editUrl":"https://github.com/departement-info-cem/ProjetGruMinion2024/tree/main/yadian/2024-04-29-semaine9.md","source":"@site/yadian/2024-04-29-semaine9.md","title":"Semaine 9","description":"\xc0 venir","date":"2024-04-29T00:00:00.000Z","tags":[],"readingTime":0.01,"hasTruncateMarker":false,"authors":[{"name":"Yadian Betancourt Paujaud","title":"D\xe9veloppeur","url":"https://github.com/yadianbetancourt","imageURL":"https://avatars.githubusercontent.com/u/104099685?v=4","key":"yadian"}],"frontMatter":{"authors":"yadian"},"unlisted":false,"prevItem":{"title":"Semaine 10","permalink":"/ProjetGruMinion2024/yadian/2024/05/06/semaine10"},"nextItem":{"title":"Semaine 8","permalink":"/ProjetGruMinion2024/yadian/2024/04/22/semaine8"}},"content":"\xc0 venir"},{"id":"/2024/04/22/semaine8","metadata":{"permalink":"/ProjetGruMinion2024/yadian/2024/04/22/semaine8","editUrl":"https://github.com/departement-info-cem/ProjetGruMinion2024/tree/main/yadian/2024-04-22-semaine8.md","source":"@site/yadian/2024-04-22-semaine8.md","title":"Semaine 8","description":"Cette semaine, je me suis lanc\xe9 sur un mini-jeu qui s\u2019appelle Brick Breaker afin de l\u2019inclure dans le projet de mes coll\xe8gues. Mon projet personnel est d\xe9j\xe0 termin\xe9, mais il me reste encore 2 semaines, donc j\u2019essaie de rester productif. Je suis \xe9galement entr\xe9 dans le magasin d\u2019assets itch.io et j\u2019ai d\xe9couvert des nouveaux assets gratuits int\xe9ressants. J\u2019ai donc commenc\xe9 aussi \xe0 programmer le jeu Sprout Lands qui ressemble un peu et qui a la m\xeame logique de jeu que Stardew Valley. De plus, je tiens mon site et le site du projet \xe0 jour avec mon journal de d\xe9veloppement.","date":"2024-04-22T00:00:00.000Z","tags":[],"readingTime":0.5,"hasTruncateMarker":false,"authors":[{"name":"Yadian Betancourt Paujaud","title":"D\xe9veloppeur","url":"https://github.com/yadianbetancourt","imageURL":"https://avatars.githubusercontent.com/u/104099685?v=4","key":"yadian"}],"frontMatter":{"authors":"yadian"},"unlisted":false,"prevItem":{"title":"Semaine 9","permalink":"/ProjetGruMinion2024/yadian/2024/04/29/semaine9"},"nextItem":{"title":"Semaine 7","permalink":"/ProjetGruMinion2024/yadian/2024/04/15/semaine7"}},"content":"Cette semaine, je me suis lanc\xe9 sur un mini-jeu qui s\u2019appelle Brick Breaker afin de l\u2019inclure dans le projet de mes coll\xe8gues. Mon projet personnel est d\xe9j\xe0 termin\xe9, mais il me reste encore 2 semaines, donc j\u2019essaie de rester productif. Je suis \xe9galement entr\xe9 dans le magasin d\u2019assets itch.io et j\u2019ai d\xe9couvert des nouveaux assets gratuits int\xe9ressants. J\u2019ai donc commenc\xe9 aussi \xe0 programmer le jeu Sprout Lands qui ressemble un peu et qui a la m\xeame logique de jeu que Stardew Valley. De plus, je tiens mon site et le site du projet \xe0 jour avec mon journal de d\xe9veloppement."},{"id":"/2024/04/15/semaine7","metadata":{"permalink":"/ProjetGruMinion2024/yadian/2024/04/15/semaine7","editUrl":"https://github.com/departement-info-cem/ProjetGruMinion2024/tree/main/yadian/2024-04-15-semaine7.md","source":"@site/yadian/2024-04-15-semaine7.md","title":"Semaine 7","description":"Cette semaine, je voulais faire quelque chose de diff\xe9rent. J\u2019ai donc mis mon bug de manette de c\xf4t\xe9 et j\u2019ai d\xe9ploy\xe9 la d\xe9mo du jeu sur le web. J\u2019ai aussi commenc\xe9 mon webfolio, un site web pour pr\xe9senter mes projets. Je suis all\xe9 lire la documentation d\u2019Angular puisque \xe7a faisait un bout que je n\u2019avais pas touch\xe9 ce framework. Lorsque j\u2019avais une base, je l\u2019ai \xe9galement d\xe9ploy\xe9. J\u2019avais d\xe9j\xe0 vu quelques tiktoks de programmeur qui font du code html, css et des scripts tr\xe8s int\xe9ressants. J\u2019ai reproduit le code afin de l\u2019inclure dans mon site. J\u2019ai \xe9galement appris comment injecter un script dans un component ce qui est tr\xe8s utile.","date":"2024-04-15T00:00:00.000Z","tags":[],"readingTime":0.55,"hasTruncateMarker":false,"authors":[{"name":"Yadian Betancourt Paujaud","title":"D\xe9veloppeur","url":"https://github.com/yadianbetancourt","imageURL":"https://avatars.githubusercontent.com/u/104099685?v=4","key":"yadian"}],"frontMatter":{"authors":"yadian"},"unlisted":false,"prevItem":{"title":"Semaine 8","permalink":"/ProjetGruMinion2024/yadian/2024/04/22/semaine8"},"nextItem":{"title":"Semaine 6","permalink":"/ProjetGruMinion2024/yadian/2024/04/08/semaine6"}},"content":"Cette semaine, je voulais faire quelque chose de diff\xe9rent. J\u2019ai donc mis mon bug de manette de c\xf4t\xe9 et j\u2019ai d\xe9ploy\xe9 la d\xe9mo du jeu sur le web. J\u2019ai aussi commenc\xe9 mon webfolio, un site web pour pr\xe9senter mes projets. Je suis all\xe9 lire la documentation d\u2019Angular puisque \xe7a faisait un bout que je n\u2019avais pas touch\xe9 ce framework. Lorsque j\u2019avais une base, je l\u2019ai \xe9galement d\xe9ploy\xe9. J\u2019avais d\xe9j\xe0 vu quelques tiktoks de programmeur qui font du code html, css et des scripts tr\xe8s int\xe9ressants. J\u2019ai reproduit le code afin de l\u2019inclure dans mon site. J\u2019ai \xe9galement appris comment injecter un script dans un component ce qui est tr\xe8s utile."},{"id":"/2024/04/08/semaine6","metadata":{"permalink":"/ProjetGruMinion2024/yadian/2024/04/08/semaine6","editUrl":"https://github.com/departement-info-cem/ProjetGruMinion2024/tree/main/yadian/2024-04-08-semaine6.md","source":"@site/yadian/2024-04-08-semaine6.md","title":"Semaine 6","description":"J\u2019ai fini d\u2019implanter le mode multijoueur dans la d\xe9mo et je l\u2019ai int\xe9gr\xe9 dans le projet initial. J\u2019ai configur\xe9 la manette pour le joueur num\xe9ro 2. J\u2019ai jou\xe9 un peu afin de tester si tout fonctionnait comme il faut. Il y avait quelque bugs lors du revive, lors de l\u2019affichage des overlays. J\u2019ai corrig\xe9 ces erreurs et j\u2019ai continuer \xe0 tester. En jouant avec deux manettes \xe0 m\xeame temps, j\u2019ai trouv\xe9 un autre bug, une fois que j\u2019appuie sur un bouton sur la manette mon personnage n\u2019arr\xeate pas de bouger m\xeame si le bouton n\u2019est plus appuy\xe9. J\u2019ai fini la semaine sans trouver un fix.","date":"2024-04-08T00:00:00.000Z","tags":[],"readingTime":0.525,"hasTruncateMarker":false,"authors":[{"name":"Yadian Betancourt Paujaud","title":"D\xe9veloppeur","url":"https://github.com/yadianbetancourt","imageURL":"https://avatars.githubusercontent.com/u/104099685?v=4","key":"yadian"}],"frontMatter":{"authors":"yadian"},"unlisted":false,"prevItem":{"title":"Semaine 7","permalink":"/ProjetGruMinion2024/yadian/2024/04/15/semaine7"},"nextItem":{"title":"Semaine 5","permalink":"/ProjetGruMinion2024/yadian/2024/04/01/semaine5"}},"content":"J\u2019ai fini d\u2019implanter le mode multijoueur dans la d\xe9mo et je l\u2019ai int\xe9gr\xe9 dans le projet initial. J\u2019ai configur\xe9 la manette pour le joueur num\xe9ro 2. J\u2019ai jou\xe9 un peu afin de tester si tout fonctionnait comme il faut. Il y avait quelque bugs lors du revive, lors de l\u2019affichage des overlays. J\u2019ai corrig\xe9 ces erreurs et j\u2019ai continuer \xe0 tester. En jouant avec deux manettes \xe0 m\xeame temps, j\u2019ai trouv\xe9 un autre bug, une fois que j\u2019appuie sur un bouton sur la manette mon personnage n\u2019arr\xeate pas de bouger m\xeame si le bouton n\u2019est plus appuy\xe9. J\u2019ai fini la semaine sans trouver un fix."},{"id":"/2024/04/01/semaine5","metadata":{"permalink":"/ProjetGruMinion2024/yadian/2024/04/01/semaine5","editUrl":"https://github.com/departement-info-cem/ProjetGruMinion2024/tree/main/yadian/2024-04-01-semaine5.md","source":"@site/yadian/2024-04-01-semaine5.md","title":"Semaine 5","description":"Cette semaine, il fallait que je stock quelque part le nom du personnage choisis par joueur num\xe9ro 1 et par joueur num\xe9ro 2. Il fallait aussi stocker le niveau s\xe9lectionn\xe9. J\u2019ai essay\xe9 plusieurs m\xe9thodes, mais j\u2019ai fini par les stocker dans une classe config tout en envoyant des messages entre les machines afin que les valeurs soient \xe0 jour des deux c\xf4t\xe9s puisque la classe config locale. J\u2019ai \xe9galement d\xe9cid\xe9 d\u2019implanter le mode multijoueur dans la d\xe9mo, car \xe7a allait faciliter les tests et les modifications.","date":"2024-04-01T00:00:00.000Z","tags":[],"readingTime":0.43,"hasTruncateMarker":false,"authors":[{"name":"Yadian Betancourt Paujaud","title":"D\xe9veloppeur","url":"https://github.com/yadianbetancourt","imageURL":"https://avatars.githubusercontent.com/u/104099685?v=4","key":"yadian"}],"frontMatter":{"authors":"yadian"},"unlisted":false,"prevItem":{"title":"Semaine 6","permalink":"/ProjetGruMinion2024/yadian/2024/04/08/semaine6"},"nextItem":{"title":"Semaine 4","permalink":"/ProjetGruMinion2024/yadian/2024/03/25/semaine4"}},"content":"Cette semaine, il fallait que je stock quelque part le nom du personnage choisis par joueur num\xe9ro 1 et par joueur num\xe9ro 2. Il fallait aussi stocker le niveau s\xe9lectionn\xe9. J\u2019ai essay\xe9 plusieurs m\xe9thodes, mais j\u2019ai fini par les stocker dans une classe config tout en envoyant des messages entre les machines afin que les valeurs soient \xe0 jour des deux c\xf4t\xe9s puisque la classe config locale. J\u2019ai \xe9galement d\xe9cid\xe9 d\u2019implanter le mode multijoueur dans la d\xe9mo, car \xe7a allait faciliter les tests et les modifications."},{"id":"/2024/03/25/semaine4","metadata":{"permalink":"/ProjetGruMinion2024/yadian/2024/03/25/semaine4","editUrl":"https://github.com/departement-info-cem/ProjetGruMinion2024/tree/main/yadian/2024-03-25-semaine4.md","source":"@site/yadian/2024-03-25-semaine4.md","title":"Semaine 4","description":"Cette semaine pour atteindre mon prochain objectif, il fallait que je trouve une fa\xe7on de d\xe9finir quelle sera la manette 1 et qui sera la manette 2. J\u2019ai essay\xe9 plusieurs m\xe9thodes, mais sans succ\xe8s. Cependant, j\u2019ai appris quelques trucs qui m\u2019ont aid\xe9 par la suite. J\u2019ai appris que toutes les variables sont locales et elles ne sont pas partag\xe9es entre les machines. \xc0 cause du temps que j\u2019avais perdu et en regardant ce qu\u2019il me restait \xe0 faire, j\u2019ai fini par simplement afficher un dialogue apr\xe8s que les tablettes soient connect\xe9es afin de choisir qui est le joueur num\xe9ro 1 ou 2.","date":"2024-03-25T00:00:00.000Z","tags":[],"readingTime":0.51,"hasTruncateMarker":false,"authors":[{"name":"Yadian Betancourt Paujaud","title":"D\xe9veloppeur","url":"https://github.com/yadianbetancourt","imageURL":"https://avatars.githubusercontent.com/u/104099685?v=4","key":"yadian"}],"frontMatter":{"authors":"yadian"},"unlisted":false,"prevItem":{"title":"Semaine 5","permalink":"/ProjetGruMinion2024/yadian/2024/04/01/semaine5"},"nextItem":{"title":"Semaine 3","permalink":"/ProjetGruMinion2024/yadian/2024/03/18/semaine3"}},"content":"Cette semaine pour atteindre mon prochain objectif, il fallait que je trouve une fa\xe7on de d\xe9finir quelle sera la manette 1 et qui sera la manette 2. J\u2019ai essay\xe9 plusieurs m\xe9thodes, mais sans succ\xe8s. Cependant, j\u2019ai appris quelques trucs qui m\u2019ont aid\xe9 par la suite. J\u2019ai appris que toutes les variables sont locales et elles ne sont pas partag\xe9es entre les machines. \xc0 cause du temps que j\u2019avais perdu et en regardant ce qu\u2019il me restait \xe0 faire, j\u2019ai fini par simplement afficher un dialogue apr\xe8s que les tablettes soient connect\xe9es afin de choisir qui est le joueur num\xe9ro 1 ou 2."},{"id":"/2024/03/18/semaine3","metadata":{"permalink":"/ProjetGruMinion2024/yadian/2024/03/18/semaine3","editUrl":"https://github.com/departement-info-cem/ProjetGruMinion2024/tree/main/yadian/2024-03-18-semaine3.md","source":"@site/yadian/2024-03-18-semaine3.md","title":"Semaine 3","description":"Tout se passe bien. Cette semaine, j\u2019ai int\xe9gr\xe9 la d\xe9mo sur le projet initial. Je suis plus concentr\xe9 le UI, car il faudrait \xeatre capable de choisir un personnage et un niveau avant de commencer \xe0 jouer. Je veux avoir aussi quelque chose de pr\xe9sentable. Arriv\xe9 \xe0 la fin de semaine, j\u2019ai fait une petite pr\xe9sentation du projet. La manette poss\xe8de quelques d\xe9fauts, il y a un certain d\xe9lai pour que le personnage suive les commandes envoy\xe9es depuis la manette. \xc0 part cela, l\u2019interface est tr\xe8s r\xe9ussie et le jeu aussi. Prochaine \xe9tape, ajouter le mode multijoueur.","date":"2024-03-18T00:00:00.000Z","tags":[],"readingTime":0.485,"hasTruncateMarker":false,"authors":[{"name":"Yadian Betancourt Paujaud","title":"D\xe9veloppeur","url":"https://github.com/yadianbetancourt","imageURL":"https://avatars.githubusercontent.com/u/104099685?v=4","key":"yadian"}],"frontMatter":{"authors":"yadian"},"unlisted":false,"prevItem":{"title":"Semaine 4","permalink":"/ProjetGruMinion2024/yadian/2024/03/25/semaine4"},"nextItem":{"title":"Semaine 2","permalink":"/ProjetGruMinion2024/yadian/2024/03/11/semaine2"}},"content":"Tout se passe bien. Cette semaine, j\u2019ai int\xe9gr\xe9 la d\xe9mo sur le projet initial. Je suis plus concentr\xe9 le UI, car il faudrait \xeatre capable de choisir un personnage et un niveau avant de commencer \xe0 jouer. Je veux avoir aussi quelque chose de pr\xe9sentable. Arriv\xe9 \xe0 la fin de semaine, j\u2019ai fait une petite pr\xe9sentation du projet. La manette poss\xe8de quelques d\xe9fauts, il y a un certain d\xe9lai pour que le personnage suive les commandes envoy\xe9es depuis la manette. \xc0 part cela, l\u2019interface est tr\xe8s r\xe9ussie et le jeu aussi. Prochaine \xe9tape, ajouter le mode multijoueur."},{"id":"/2024/03/11/semaine2","metadata":{"permalink":"/ProjetGruMinion2024/yadian/2024/03/11/semaine2","editUrl":"https://github.com/departement-info-cem/ProjetGruMinion2024/tree/main/yadian/2024-03-11-semaine2.md","source":"@site/yadian/2024-03-11-semaine2.md","title":"Semaine 2","description":"J\u2019ai fini de voir les tutoriels de Spellthorn et j\u2019ai un plan de match plus clair pour le projet. Pendant cette semaine, j\u2019ai essay\xe9 de commencer \xe0 reproduire du code par moi-m\xeame. J\u2019ai fait beaucoup de recherche et j\u2019ai explor\xe9 la documentions de flame. Les prochaines \xe9tapes \xe9taient de configurer la cam\xe9ra pour qu\u2019elle suive le joueur, ajouter les bounds (limites de la carte), et ajouter des fonctionnalit\xe9s au joueur telles que le double jump et le wall jump. J\u2019ai aussi d\xe9cid\xe9 de cr\xe9er un projet appel\xe9 GameWithY qui allait \xeatre la d\xe9mo du jeu, car en debuggant sur les tablettes, je perdais trop de temps.","date":"2024-03-11T00:00:00.000Z","tags":[],"readingTime":0.53,"hasTruncateMarker":false,"authors":[{"name":"Yadian Betancourt Paujaud","title":"D\xe9veloppeur","url":"https://github.com/yadianbetancourt","imageURL":"https://avatars.githubusercontent.com/u/104099685?v=4","key":"yadian"}],"frontMatter":{"authors":"yadian"},"unlisted":false,"prevItem":{"title":"Semaine 3","permalink":"/ProjetGruMinion2024/yadian/2024/03/18/semaine3"},"nextItem":{"title":"Semaine 1","permalink":"/ProjetGruMinion2024/yadian/2024/03/04/semaine1"}},"content":"J\u2019ai fini de voir les tutoriels de Spellthorn et j\u2019ai un plan de match plus clair pour le projet. Pendant cette semaine, j\u2019ai essay\xe9 de commencer \xe0 reproduire du code par moi-m\xeame. J\u2019ai fait beaucoup de recherche et j\u2019ai explor\xe9 la documentions de flame. Les prochaines \xe9tapes \xe9taient de configurer la cam\xe9ra pour qu\u2019elle suive le joueur, ajouter les bounds (limites de la carte), et ajouter des fonctionnalit\xe9s au joueur telles que le double jump et le wall jump. J\u2019ai aussi d\xe9cid\xe9 de cr\xe9er un projet appel\xe9 GameWithY qui allait \xeatre la d\xe9mo du jeu, car en debuggant sur les tablettes, je perdais trop de temps."},{"id":"/2024/03/04/semaine1","metadata":{"permalink":"/ProjetGruMinion2024/yadian/2024/03/04/semaine1","editUrl":"https://github.com/departement-info-cem/ProjetGruMinion2024/tree/main/yadian/2024-03-04-semaine1.md","source":"@site/yadian/2024-03-04-semaine1.md","title":"Semaine 1","description":"Lors de la premi\xe8re semaine, Joris et Pierre-Olivier nous ont pr\xe9sent\xe9 le projet. Le but de ce projet est de faire un jeux flutter avec plusieurs modes de jeux ou niveaux. Ce jeu prendra au moins deux tablettes, une sera l\u2019\xe9cran et l\u2019autre une manette, donc style console Wii. Il aura la possibilit\xe9 d\u2019avoir une mode multijoueur aussi. Donc pour commencer cette premi\xe8re semaine de travail, j\u2019ai regard\xe9 des vid\xe9os sur le canal YouTube de Spellthorn afin de comprendre comment flame fonctionne avec flutter. Tout en regardant, j\u2019ai reproduit le code. Selon moi, le reproduire \xe9tait plus stimulant pour mon apprentissage que prendre le repo existant.","date":"2024-03-04T00:00:00.000Z","tags":[],"readingTime":0.53,"hasTruncateMarker":false,"authors":[{"name":"Yadian Betancourt Paujaud","title":"D\xe9veloppeur","url":"https://github.com/yadianbetancourt","imageURL":"https://avatars.githubusercontent.com/u/104099685?v=4","key":"yadian"}],"frontMatter":{"authors":"yadian"},"unlisted":false,"prevItem":{"title":"Semaine 2","permalink":"/ProjetGruMinion2024/yadian/2024/03/11/semaine2"}},"content":"Lors de la premi\xe8re semaine, Joris et Pierre-Olivier nous ont pr\xe9sent\xe9 le projet. Le but de ce projet est de faire un jeux flutter avec plusieurs modes de jeux ou niveaux. Ce jeu prendra au moins deux tablettes, une sera l\u2019\xe9cran et l\u2019autre une manette, donc style console Wii. Il aura la possibilit\xe9 d\u2019avoir une mode multijoueur aussi. Donc pour commencer cette premi\xe8re semaine de travail, j\u2019ai regard\xe9 des vid\xe9os sur le canal YouTube de Spellthorn afin de comprendre comment flame fonctionne avec flutter. Tout en regardant, j\u2019ai reproduit le code. Selon moi, le reproduire \xe9tait plus stimulant pour mon apprentissage que prendre le repo existant."}]}')}}]);